import React from 'react';
function Note(inf){
    return(
        <div class="notes-container">
        <div class="kdrama-note">
            <h2 class="kdrama-title">{inf.title}</h2>
            <p class="kdrama-description">{inf.des}</p>
      </div>
      </div>
    );
}
export default Note;
